import React, { Component } from 'react';

export default class WeeklyGoals extends React.Component {

    constructor()
    {
        super();
        this.state = {
            "collapsed": true
        }
    }

    buildList()
    {
        const ls_detail = this.props.goals_list.map( goal => (<h4> {goal.id + ". " + goal.title} </h4>));

        return (
            <ul>
                {ls_detail}
            </ul>
        );
    }

    render() {
        return (
            <div className="Weekly_Goals">
                <h2>Weekly Goals</h2>
                {this.buildList()}
            </div>
        )
    }
}
